function Button({ colour, index }) {
    return (
        <>
        {Colours.map((colour, index) => (
            <button
                key={index}
                className="colour"
                id={colour}
                style={{ backgroundColor: colour }}
            ></button>
        ))}
        </>
    );
}

export default Button;
